text:
@ginabarboza 🙏🙏🙏 thank you.. you are a love..a fighter..a ride or die.. a savoir and more than you know.. a visionary who has only just begun... thank you for allowing me to participate in your baby ....to save other babies everywhere ... ok.... i will make a compilation of this documentary in the next couple of day including... bts and parts of my interview and declarations for anyone out there still hurting.. my promise to fight right next to and for you when you can't .. i have a small few with capes who are always there in my life... let me wear a cape for others..... @calbowdler
@morillatitan ... documentary is and will be in and around all the film festivals and yes that is exciting.. but and yes i mean but and not however.. because but it really doesnt matter as long as it helps someone who hurts or is afraid  to come forward ..ask for help... feel safe... feel worthy.. i pray to give children a voice...
to be heard.. because when you aren not heard .. the rest of your life..you believe your voice ..your mind.. your brain.. your heartfelt anything means nothing... i #pray to help open up the floor for everyone who needs to speak.. to roar.. to scream.. to express... to be whoever outloud ...just be .. and unafraid doing it!!!.unapolijetic.. you can be humble and have a voice.. you can be meek and have rights...
you can be you and be loved..
#thepromises #giftsfromgod #cherishyourself #metoo #meonly #thelordfirst #friendswhocare #chooseyourfamily #oneinamillion

